RU{В каких строках трассы существует переменная "a" из 5 строки программы, из 1 итерации цикла? &lt;pre&gt;&lt;code id="editor" class="language-cpp"&gt;1.void main() {
2.	int a = 5;
3.		for (int c = 0; c &lt; 2; c++) { 
4.			int d = 3; 
5.			int a = 2;
6.			d = d + c;
7.	}
8.	a += 3; 
9.}&lt;/code&gt;&lt;/pre&gt;} EN{In which lines of the trace does the variable "a" from line 5 of the program, from iteration 1 of the loop exist? &lt;pre&gt;&lt;code id="editor" class="language-cpp"&gt;1.void main() {
2.	int a = 5;
3.		for (int c = 0; c &lt; 2; c++) { 
4.			int d = 3; 
5.			int a = 2;
6.			d = d + c;
7.	}
8.	a += 3; 
9.}&lt;/code&gt;&lt;/pre&gt;}
